import React from "react";
import { useDispatch } from "react-redux";
import { Chat } from "..";
import { answerStatus } from "../reducer/chatbotSlice";

export default function ChatBotPage(){
    const dispatch = useDispatch()
    dispatch(answerStatus({'symptom': 'fever', 'details':'38.4℃ 이하'}))
    return(<>
        <Chat/>
    </>)
}
